INSERT INTO workshop.jk_order_stage (id, created_at, created_by, updated_at, updated_by, deleted_at, deleted_by, order_id, status_id, comment, comment2, field1, field2, field3, field4, field5) VALUES (25, 1612358338, 175, null, null, null, null, 9, 7, '<p>Необходимо вложить: 1) единый жилищный документ на себя и членов семьи, 2) в заявлении указать ходатайство руководителя. 3) согласие на обработку персональных данных членов семьи, 4) справку 2-НДФЛ за 2020 год и январь 2021, 5) справку из Центра занятости о безработице на супруга.</p><p>Необходимо изменить категорию: молодой работник - да</p>', null, null, null, null, null, null);
