INSERT INTO workshop.jk_order_stage (id, created_at, created_by, updated_at, updated_by, deleted_at, deleted_by, order_id, status_id, comment, comment2, field1, field2, field3, field4, field5) VALUES (36, 1612446949, 745, null, null, null, null, 17, 2, 'Согласование руководителями', null, null, null, null, null, null);
INSERT INTO workshop.jk_order_stage (id, created_at, created_by, updated_at, updated_by, deleted_at, deleted_by, order_id, status_id, comment, comment2, field1, field2, field3, field4, field5) VALUES (37, 1612447827, 111, null, null, null, null, 8, 7, '<p>Наталья, по заявке необходимо:</p><p>1) на вкл Дети вложить свидетельство о регистрации по месту жительства, вложить справки о фактическом месте проживания от мамы и папы</p><p>2) на вкл Жилье отразить сделки по отчуждению имущества за последние 5 лет</p><p>3) на вкл Документы вложить Согласие на ребенка, далее нажать на Сохранить, после выгрузить бланк Заявления, распечатать, подписать и вложить новый бланк заявления</p>', null, null, null, null, null, null);
