INSERT INTO workshop.jk_order_stage (id, created_at, created_by, updated_at, updated_by, deleted_at, deleted_by, order_id, status_id, comment, comment2, field1, field2, field3, field4, field5) VALUES (46, 1612507314, 111, null, null, null, null, 12, 7, '<p>Елена, по заявке необходимо:</p>  <p>1) на вкл Жилье по полю «В течение 5 лет, предшествующих дню подачи настоящего заявления, я и члены моей семьи осуществляли следующие сделки с недвижимостью» уточнить информацию на:</p>  <p>Иванова Е.И. продала 06.08.2020 ½ долю в 1-комнатной квартире по адресу: Московская область, Красногорский р-н, вблизи г. Красногорска, на земельном участке с кадастровым номером:50:11:0010104:595, общей площадью 34,5 кв.м.</p>  <p>2) на вкл Работник по полю Единый жилищный документ (вложение) вложить ЕЖД (или Выписку из домовой книги, или Справку о регистрации, или Справку о составе семьи, которые берутся по месту вашей регистрации)</p>  <p>3) на вкл Документы нажать на Сохранить, после выгрузить бланк Заявления, распечатать, подписать и вложить новый бланк заявления</p>', null, null, null, null, null, null);
INSERT INTO workshop.jk_order_stage (id, created_at, created_by, updated_at, updated_by, deleted_at, deleted_by, order_id, status_id, comment, comment2, field1, field2, field3, field4, field5) VALUES (47, 1612508499, 111, null, null, null, null, 8, 7, '<p>Наталья, по заявке необходимо:</p>  <p>1) на вкл Жилье по полю «В течение 5 лет, предшествующих дню подачи настоящего заявления, я и члены моей семьи осуществляли следующие сделки с недвижимостью» уточнить информацию на:</p>  <p>Жолудева Н.В. продала 25.04.2019 ½ долю в 2-х комнатной квартире по адресу: Московская область, г. Красногорск, ул. Братьев Горожанкиных д 30 кв 15 , общей площадью 49,6 кв.м.</p>  <p>Жолудев А.В. продал 25.04.2019 ½ долю в 2-х комнатной квартире по адресу: Московская область, г. Красногорск, ул. Братьев Горожанкиных д 30 кв 15 , общей площадью 49,6 кв.м.</p>  <p>Жолудева П.А. – сделок не было</p>  <p>2) на вкл Документы по полю «Жолудева Полина Алексеевна Согласие на обработку персональных данных (вложение)» вложить Согласие на ребенка</p>  <p>3) на вкл Документы нажать на Сохранить, после выгрузить бланк Заявления, распечатать, подписать и вложить новый бланк заявления</p><h3></h3>', null, null, null, null, null, null);
