INSERT INTO workshop.jk_order_stage (id, created_at, created_by, updated_at, updated_by, deleted_at, deleted_by, order_id, status_id, comment, comment2, field1, field2, field3, field4, field5) VALUES (79, 1612787061, 111, null, null, null, null, 20, 7, '<p>Владимир, по заявке необходимо:</p>  <p>1) на вкл Работник по полю «Паспорт работника (вложение)» вложить Паспорт (все страницы) с учетом страницы «Дети»</p>  <p>2) на вкл Жилье по полю «Договор приобретения жилого помещения (вложение)» вложить Договор купли-продажи жилого помещения</p>  <p>3) на вкл Документы нажать на Сохранить, далее Отправить.</p>', null, null, null, null, null, null);
