INSERT INTO workshop.jk_order_stage (id, created_at, created_by, updated_at, updated_by, deleted_at, deleted_by, order_id, status_id, comment, comment2, field1, field2, field3, field4, field5) VALUES (86, 1612789335, 111, null, null, null, null, 15, 7, '<p>Елизавета, по заявке необходимо:</p>  <p>1) на вкл Финансы по полю «Справка 2 НДФЛ (вложение)» вложить Справку с подписью/печатью</p>  <p>2) на вкл Документы нажать на Сохранить, далее выгрузить Бланк заявления на оказание МП, распечатать, подписать и прикрепить скан-копию. После Сохранить и отправить на согласование.</p>', null, null, null, null, null, null);
INSERT INTO workshop.jk_order_stage (id, created_at, created_by, updated_at, updated_by, deleted_at, deleted_by, order_id, status_id, comment, comment2, field1, field2, field3, field4, field5) VALUES (87, 1612792238, 160, null, null, null, null, 3, 7, '<p>Добрый день. Внестие правки в заявку:</p><p>- Не верно указана серия паспорта.</p>  <p>- Паспорт - должны быть все страницы в том числе и пустые.</p>  <p>- Сканы документов разделить и вложить отдельно по разделам.</p>  <p>- В разделе Единый жилищный документ вложить скан Справки о составе семьи.</p>  <p>- В разделе жилье добавить информацию о площадях имеющегося жилья (как в документах с десятыми). Уточнить сделку в течение 5 лет (купля /продажа и т.п.) и площадь 1-комн квартиры.</p>  <p>- Указать точную полную стоимость жилья – 2750000 (как в договоре), и собственные средства уточнить.</p>  <p>- Не указан процент по кредиту, уточнить срок кредита по договору (15 лет).</p>  <p>- В разделе «сумма процентов по ипотеке» вносится информация о % банку по графику, а не полный платеж.</p>  <p>- Среднемесячный доход на 1 члена семьи = (443614,31-55042)/12=32381,03 - исправить.</p>  <p>- Среднемесячные платежи – Уточните. Указывается платеж по ипотечному кредиту, если еще есть кредит – общую сумму платежей.</p>  <p>- Вложить копию документа - свидетельство о заключении или расторжении брака.</p>    <p>После внесения правок сформировать новое заявление и согласие.</p>', null, null, null, null, null, null);
