INSERT INTO workshop.jk_order_stage (id, created_at, created_by, updated_at, updated_by, deleted_at, deleted_by, order_id, status_id, comment, comment2, field1, field2, field3, field4, field5) VALUES (99, 1612849827, 166, null, null, null, null, 27, 7, '<p>Добрый день!</p><p>Необходимо внести следующие изменения:</p><p>1. изменить стоимость приобретенного жилья, согласно договора 1 530 000</p><p>2. распечать  заявление, подписать и вложить</p><p>3. распечатать согласие на обработку персональных данных, подписать и вложить;</p><p>4. заменить первоначальный график платежей, т.к отсканирован не корректно;</p><p>5. заменть ипотечный договор, т.к вложения не открывется;</p><p>6. необходимо вложить расписку о передаче денежныз средств.</p>', null, null, null, null, null, null);
