INSERT INTO workshop.jk_order_stage (id, created_at, created_by, updated_at, updated_by, deleted_at, deleted_by, order_id, status_id, comment, comment2, field1, field2, field3, field4, field5) VALUES (246, 1613405149, 111, null, null, null, null, 10, 7, '<p>Алексей, по заявке необходимо:</p>  <p>1) на вкл Жилье по полю Я и члены моей семьи имеем в собственности следующие жилые помещения (доли в жилых помещениях) указать:</p>  <p>Объедкин А.В. владеет 1-комнатной квартирой: 143025 Московская Область, Одинцовский район, с.Немчиновка, ул.Рублёвский проезд, д.20Б, кв.14, общая площадь 28,8 кв.м.<br> Ступина А.О. не владееет жилыми помещениями<br> Объедкина П.А. не владеет жилыми помещениями</p>  <p>2) на вкл Документы нажать на Сохранить, после выгрузить бланк Заявления, распечатать, подписать и вложить новый бланк заявления</p>', null, null, null, null, null, null);
