INSERT INTO workshop.jk_order_stage (id, created_at, created_by, updated_at, updated_by, deleted_at, deleted_by, order_id, status_id, comment, comment2, field1, field2, field3, field4, field5) VALUES (263, 1613466991, 169, null, null, null, null, 51, 9, '<p>Кандидат соответствует требованиям Положения по ЖП</p>', null, null, null, null, null, null);
INSERT INTO workshop.jk_order_stage (id, created_at, created_by, updated_at, updated_by, deleted_at, deleted_by, order_id, status_id, comment, comment2, field1, field2, field3, field4, field5) VALUES (264, 1613468500, 184, null, null, null, null, 63, 7, '<p>Необходимо приложить следующие документы:</p><p>1.Свидетельво о рождении на Давида Андреевича.</p><p>2.Свидетельства о регистрации права собственности квартиры по адресу Полынковская 65В к1 кв 92.</p><p>В заявлении указать:</p><p>1. На сколько лет будет предоставлена компенсация процентов</p><p>2. Уточнить текущие условия кредита: количество лет и процентную ставку.</p><p>3. Отредактировать среднемесячный доход на одного члена семьи (12602,62р.).</p>', null, null, null, null, null, null);
INSERT INTO workshop.jk_order_stage (id, created_at, created_by, updated_at, updated_by, deleted_at, deleted_by, order_id, status_id, comment, comment2, field1, field2, field3, field4, field5) VALUES (265, 1613469383, 184, null, null, null, null, 52, 7, '<p>Необходимо вложить:</p><p>1.Акт приема-передачи жилого помещения</p><p>2.Согласие на супруга (во вложении Единый жилищный документ)</p><p>В заявлении указать процентную ставку по кредиту.</p><p>В заявлении отредактировать  среднемесячный доход на одного члена семьи (52739,29р)</p>', null, null, null, null, null, null);
INSERT INTO workshop.jk_order_stage (id, created_at, created_by, updated_at, updated_by, deleted_at, deleted_by, order_id, status_id, comment, comment2, field1, field2, field3, field4, field5) VALUES (266, 1613470325, 111, null, null, null, null, 45, 9, '<p>Пакет документов проверен</p>', null, null, null, null, null, null);
INSERT INTO workshop.jk_order_stage (id, created_at, created_by, updated_at, updated_by, deleted_at, deleted_by, order_id, status_id, comment, comment2, field1, field2, field3, field4, field5) VALUES (267, 1613472593, 187, null, null, null, null, 50, 7, '<p>Добрый день!</p><p>1. В заявлении необходимо указать % ставку по ипотеке</p><p>2. Вложить акт приема-передачи, выписку из ЕГРН<br></p>', null, null, null, null, null, null);
INSERT INTO workshop.jk_order_stage (id, created_at, created_by, updated_at, updated_by, deleted_at, deleted_by, order_id, status_id, comment, comment2, field1, field2, field3, field4, field5) VALUES (268, 1613473349, 187, null, null, null, null, 32, 7, '<p>Добрый день.</p><p>1. Во вкладке "Дети" по Шахманаеву К.А. вместо свидетельства вложен паспорт</p><p>2. Как посчитан среднемесячный доход? С учетом алиментов? И что за платежи 1000р и 9333?<br></p>', null, null, null, null, null, null);
INSERT INTO workshop.jk_order_stage (id, created_at, created_by, updated_at, updated_by, deleted_at, deleted_by, order_id, status_id, comment, comment2, field1, field2, field3, field4, field5) VALUES (269, 1613473994, 187, null, null, null, null, 40, 7, '<p>1. Вместо свидетельства о заключении брака вложен паспорт супруга. Необходимо заменить документ.</p><p>2. Договор купли-продажи нечитаемый. Необходимо заменить документ.</p><p>3. Во вкладке "Ипотека" в разделе займ указана сумма 423 257,08 ₽. Что это?<br></p><p>4. Нет справки 2ндфл (вложена только на супруга)<br></p>', null, null, null, null, null, null);
