INSERT INTO workshop.jk_order_stage (id, created_at, created_by, updated_at, updated_by, deleted_at, deleted_by, order_id, status_id, comment, comment2, field1, field2, field3, field4, field5) VALUES (321, 1613567616, 111, null, null, null, null, 47, 7, '<p>Александр, по заявке необходимо:</p>  <p>1) на вкл Жилье по полю «Я и члены моей семьи имеем в собственности следующие жилые помещения (доли в жилых помещениях)» указать:<strong></strong></p>  <p>Малявкин А.С. – не владеет жилыми помещениями</p>  <p>Малявкина Е.С. - не владеет жилыми помещениями</p>  <p>Малявкин З.А. - не владеет жилыми помещениями</p>  <p>Саитова К.С. – не владеет жилыми помещениями</p>  <p>По полю «В течение 5 лет, предшествующих дню подачи настоящего заявления, я и члены моей семьи осуществляли следующие сделки с недвижимостью» указать:</p>  <p>Сделок не было</p>  <p>По полю Сумма общих площадей жилых помещений вашей семьи указать 0.</p>  <p>2) на вкл Финансы по полям  «Среднемесячные платежи моей семьи»  и «Мои платежи» уточнить сумму на: 93 549,54</p>  <p>3) на вкл Документы нажать на Сохранить, после выгрузить бланк Заявления, распечатать, подписать и вложить новый бланк заявления</p>', null, null, null, null, null, null);
