INSERT INTO workshop.jk_order_stage (id, created_at, created_by, updated_at, updated_by, deleted_at, deleted_by, order_id, status_id, comment, comment2, field1, field2, field3, field4, field5) VALUES (397, 1613736567, 169, null, null, null, null, 64, 7, '<p>Необходимо исправить персональные данные - нет номера паспорта, поэтому система не позволяет делать дальнейшие корректировки (вложить согласия на обр перс данных - 4шт, НДФЛ жены и свой, выписка из ЕГРН на квартиру). После этого - сформировать новое заявление, вложить и снова отправить мне</p>', null, null, null, null, null, null);
INSERT INTO workshop.jk_order_stage (id, created_at, created_by, updated_at, updated_by, deleted_at, deleted_by, order_id, status_id, comment, comment2, field1, field2, field3, field4, field5) VALUES (398, 1613736702, 184, null, null, null, null, 63, 7, '<p>1. Необходимо приложить Свидетельство о заключении брака.</p><p>2. В заявлении указано: Оксузьян А.А. имеет 1/2 долей в 2-комнатной квартире: 392028 г. Тамбов, ул. Полынковская, д. 59А, кв. 127, общей площадью 52,5 кв.м. Оксузьян А.А. имеет 1/2 долей в 2-комнатной квартире: 392028 г. Тамбов, ул. Полынковская, д. 65В к 1, кв. 92, общай площадью 53 кв.м. Оксузьян Ю.В. имеет 1/2 долей в 2-комнатной квартире: 392028 г. Тамбов, ул. Полынковская, д. 65В к 1, кв. 92, общай площадью 53 кв.м</p><p>Свидетельства о гос.регистрации права приложены на Оксузьян А.А. 1/2 Полынковская 59А кв.127<strong></strong></p><p>Оксузьян Ю.В. 1/2 Полынковская 59А кв.127</p><p><strong><br></strong></p><p><strong><br></strong></p>', null, null, null, null, null, null);
