INSERT INTO workshop.jk_order_stage (id, created_at, created_by, updated_at, updated_by, deleted_at, deleted_by, order_id, status_id, comment, comment2, field1, field2, field3, field4, field5) VALUES (428, 1613815430, 111, null, null, null, null, 30, 7, '<p>Эльвира, по заявке необходимо:</p>  <p>1) на вкл Жилье вложить к Договору приобретения жилья ЭЦП, </p>  <p>по полю «Я и члены моей семьи имеем в собственности следующие жилые помещения (доли в жилых помещениях)» уточнить формулировку на:</p>  <p>Таратухина Э.Х. – не владеет жилыми помещениями</p>  <p>Таратухин А.С. - владеет 1/3 долей в 2-х комнатной квартире по адресу: г Воронеж. Ул. Краснозвездная дом 28, кв 43. Общая площадь 42 кв. м</p>  <p>Таратухина А.А. – не владеет жилыми помещениями</p>  <p>и Таратухина В.А. – не владеет жилыми помещениями<br> <br> </p>    <p>по полю «В течение 5 лет, предшествующих дню подачи настоящего заявления, я и члены моей семьи осуществляли следующие сделки с недвижимостью» уточнить формулировку на: сделок не было</p>    <p>по полю «Сумма общих площадей жилых помещений вашей семьи» уточнить на 14</p>  <p>2) на вкл Ипотека уточнить сумму по полю «Собственные средства работника» на 628,20, </p>  <p>по полю «Размер ипотеки» на 4 179 000,00</p>  <p>3) на вкл. Финансы по полю «Среднемесячный доход на одного члена семьи после удержания налогов» уточнить на 16 634</p>  <p>3) на вкл Документы нажать на Сохранить, после выгрузить бланк Заявления, распечатать, подписать и вложить новый бланк заявления</p>', null, null, null, null, null, null);
