INSERT INTO workshop.jk_order_stage (id, created_at, created_by, updated_at, updated_by, deleted_at, deleted_by, order_id, status_id, comment, comment2, field1, field2, field3, field4, field5) VALUES (431, 1613816060, 187, null, null, null, null, 37, 7, '<p>Добрый день!</p><p>1. Необходимо откорректировать среднемесячный доход в соответствии с документами - 18 774,85 руб. (вкладка Финансы)</p><p>2. Необходимо откорректировать сумму общих площадей жилых помещений вашей семьи - 56/2=28 (вкладка Жилье)<br></p><p>3. После внесения изменений вложить новое заявление<br></p>', null, null, null, null, null, null);
INSERT INTO workshop.jk_order_stage (id, created_at, created_by, updated_at, updated_by, deleted_at, deleted_by, order_id, status_id, comment, comment2, field1, field2, field3, field4, field5) VALUES (432, 1613817088, 111, null, null, null, null, 39, 7, '<p>Наталия, по заявке необходимо:</p>  <p>1) на вкл Финансы уточнить сумму по полю «Среднемесячный доход на одного члена семьи после удержания налогов»  на 33 890</p>  <p>3) на вкл Документы нажать на Сохранить, после выгрузить бланк Заявления, распечатать, подписать и вложить новый бланк заявления</p>', null, null, null, null, null, null);
