INSERT INTO workshop.jk_order_stage (id, created_at, created_by, updated_at, updated_by, deleted_at, deleted_by, order_id, status_id, comment, comment2, field1, field2, field3, field4, field5) VALUES (505, 1614169191, 427, null, null, null, null, 31, 9, '<p>Проверено, передано для рассмотрения комиссии</p>', null, null, null, null, null, null);
INSERT INTO workshop.jk_order_stage (id, created_at, created_by, updated_at, updated_by, deleted_at, deleted_by, order_id, status_id, comment, comment2, field1, field2, field3, field4, field5) VALUES (506, 1614169554, 187, null, null, null, null, 65, 8, '<p>Добрый день!</p><p>В соответствии с п.4.3.1. "Положения об оказании помощи работникам ПАО «Ростелеком» в приобретении постоянного жилья" обязательным условием для участия в Жилищной программе является <strong></strong>отсутствие в собственности работника и членов его семьи  жилых помещений <strong>на территории Российской Федерации</strong> и отсутствие совершенных данными лицами сделок по отчуждению жилых помещений в течение 5 лет, предшествующих дате оформления заявления, общей площадью более корпоративной нормы, указанной в п.3.3 Положения.<br></p><p>К сожалению, у Вас данное условие не соблюдается. В настоящий момент сумма общих площадей жилых помещений Вашей семьи составляет 90,8 кв.м. при корпоративной норме 60 кв.м. (для семьи из 3х человек).<br></p><p><span class="redactor-invisible-space"></span><br></p>', null, null, null, null, null, null);
INSERT INTO workshop.jk_order_stage (id, created_at, created_by, updated_at, updated_by, deleted_at, deleted_by, order_id, status_id, comment, comment2, field1, field2, field3, field4, field5) VALUES (507, 1614170458, 1171, null, null, null, null, 116, 1, 'Новая заявка', null, null, null, null, null, null);
INSERT INTO workshop.jk_order_stage (id, created_at, created_by, updated_at, updated_by, deleted_at, deleted_by, order_id, status_id, comment, comment2, field1, field2, field3, field4, field5) VALUES (508, 1614171261, 427, null, null, null, null, 25, 7, '<p>Дата закрытия ипотечного договора не соответствует документу (должна быть дата, как в договоре последняя оплата 01.10.2033)</p><p>Заявление распечатать заново, т.к. не верно был расчет среднего дохода, и не верно указан срок догоора по выплате компенсации процентов</p><p>Согласовать участие в данной программе,  (в системе с руководителем Лазурьевской Е.Ю.)</p>', null, null, null, null, null, null);
INSERT INTO workshop.jk_order_stage (id, created_at, created_by, updated_at, updated_by, deleted_at, deleted_by, order_id, status_id, comment, comment2, field1, field2, field3, field4, field5) VALUES (509, 1614173002, 427, null, null, null, null, 58, 7, '<p>1. Приложить справку о проживании Лебедевой Елизаветы Сергеевна</p><p>2. Исправить стаж работы в организации</p><p>3. в закладке Жилье указать я и члены моей семьи,,, указать что заключен договор о долевом строительстве по адресу, указать м2</p><p>4. Расписать все имуществ семьи (ФИО не имеют)</p><p>5. указать % ипотеки (8,9%)</p><p>6. указать правильную сумму среднемесячного дохода (11068, это расчет только по справке 2ндфл, если будет справка о пособиях то увеличится доход)</p><p>7. Приложить справку о пособиях ФСС</p><p>7.изменить среднемесячные платежи, соласно новому графику платежей </p><p>8. Дата закрытия ипотеки 08.07.2026 (вкладка Ипотека)</p><p>8. заменить заявление, т.к не верны расчеты и данные</p><p><br></p>', null, null, null, null, null, null);
