INSERT INTO workshop.jk_order_stage (id, created_at, created_by, updated_at, updated_by, deleted_at, deleted_by, order_id, status_id, comment, comment2, field1, field2, field3, field4, field5) VALUES (715, 1614578757, 1005, null, null, null, null, 63, 5, 'Проверка куратором', null, null, null, null, null, null);
INSERT INTO workshop.jk_order_stage (id, created_at, created_by, updated_at, updated_by, deleted_at, deleted_by, order_id, status_id, comment, comment2, field1, field2, field3, field4, field5) VALUES (716, 1614578880, 187, null, null, null, null, 142, 7, '<p>Добрый день.</p><p>1. Нет заявления о фактическом проживании ребенка от папы</p><p>2. Не заполнена вкладка Супруг</p><p>3. Не заполнена вкладка Документы</p><p>4. Не заполнена вкладка Финансы</p><p>5. Не заполнена вкладка Ипотека</p><p>6. Не заполнена вкладка Жилье<br></p>', null, null, null, null, null, null);
INSERT INTO workshop.jk_order_stage (id, created_at, created_by, updated_at, updated_by, deleted_at, deleted_by, order_id, status_id, comment, comment2, field1, field2, field3, field4, field5) VALUES (717, 1614578912, 184, null, null, null, null, 63, 8, '<p>Не предоставлены необходимые документы</p>', null, null, null, null, null, null);
INSERT INTO workshop.jk_order_stage (id, created_at, created_by, updated_at, updated_by, deleted_at, deleted_by, order_id, status_id, comment, comment2, field1, field2, field3, field4, field5) VALUES (718, 1614579537, 191, null, null, null, null, 121, 7, '<p>Заменить сканы документов</p>', null, null, null, null, null, null);
