INSERT INTO workshop.jk_order_stage (id, created_at, created_by, updated_at, updated_by, deleted_at, deleted_by, order_id, status_id, comment, comment2, field1, field2, field3, field4, field5) VALUES (721, 1614579989, 282, null, null, null, null, 143, 2, 'Согласование руководителями', null, null, null, null, null, null);
INSERT INTO workshop.jk_order_stage (id, created_at, created_by, updated_at, updated_by, deleted_at, deleted_by, order_id, status_id, comment, comment2, field1, field2, field3, field4, field5) VALUES (722, 1614580619, 187, null, null, null, null, 135, 7, '<p>Добрый день!</p><p>1. Единый жилищный документ - это не выписка из ЕГРН, а справка о составе семьи. Прошу приложить правильный документ.</p><p>2. Во вкладке Ипотека нужно прописать не ежемесячный платеж, а сумму уплаченных процентов по кредиту.</p><p>3. Если ребенок студент и получает стипендию, необходимо приложить документ с суммой выплат.</p><p>4. Форму согласия на обработку перс. данных и заявление необходимо выгрузить из системы, подписать и вложить сканы. У Вас старый образец.<br></p>', null, null, null, null, null, null);
