INSERT INTO workshop.jk_order_stage (id, created_at, created_by, updated_at, updated_by, deleted_at, deleted_by, order_id, status_id, comment, comment2, field1, field2, field3, field4, field5) VALUES (742, 1614667268, 181, null, null, null, null, 146, 5, 'Проверка куратором', null, null, null, null, null, null);
INSERT INTO workshop.jk_order_stage (id, created_at, created_by, updated_at, updated_by, deleted_at, deleted_by, order_id, status_id, comment, comment2, field1, field2, field3, field4, field5) VALUES (743, 1614667831, 181, null, null, null, null, 146, 7, '<p>Заявка возвращена на исправление замечаний:</p><p>1. Исправить в профиле недостоверную информацию по дате рождения и стажу работы;</p><p>2. Вкладка "Ипотека" внести корректные суммы по ПРОЦЕНТАМ (не общий платеж);</p><p>3. Вкладка "Финансы" внести корректные данные по "среднемесячным платежам семьи" и "мои платежи". </p>', null, null, null, null, null, null);
INSERT INTO workshop.jk_order_stage (id, created_at, created_by, updated_at, updated_by, deleted_at, deleted_by, order_id, status_id, comment, comment2, field1, field2, field3, field4, field5) VALUES (744, 1614668303, 163, null, null, null, null, 19, 9, '<p>Согласовано</p>', null, null, null, null, null, null);
INSERT INTO workshop.jk_order_stage (id, created_at, created_by, updated_at, updated_by, deleted_at, deleted_by, order_id, status_id, comment, comment2, field1, field2, field3, field4, field5) VALUES (745, 1614668746, 111, null, null, null, null, 44, 7, '<p>Андрей, по заявке необходимо:</p>  <p>1) на вкл Ипотека вложить Договор ипотеки (все листы), вложить Первоначальный график платежей (все листы), вложить Актуальный график платежей (все листы (при наличии)</p>  <p>2) на вкл Финансы по полю «Справка 2 НДФЛ на супругу» вложить актуальную Справку<strong> </strong>(у приложенной истек срок годности) </p>  <p>3) на вкл Жилье вложить Договор купли-продажи и Акт приема-передачи (при наличии)</p>    <p>4) на вкл Сотрудник по полю «Количество проживающих» указано 2 человека. Уточните пожалуйста ребенок проживает с вами или отдельно?</p>    <p>5) на вкл Документы нажать на Сохранить, после выгрузить бланк Заявления, распечатать, подписать и вложить новый бланк заявления.</p>', null, null, null, null, null, null);
