INSERT INTO workshop.jk_order_stage (id, created_at, created_by, updated_at, updated_by, deleted_at, deleted_by, order_id, status_id, comment, comment2, field1, field2, field3, field4, field5) VALUES (749, 1614669378, 111, null, null, null, null, 48, 7, '<p>София, по заявке необходимо:</p>  <p>1) на вкл Документы выгрузить бланк Заявления, распечатать, подписать и вложить новый бланк заявления.</p>', null, null, null, null, null, null);
INSERT INTO workshop.jk_order_stage (id, created_at, created_by, updated_at, updated_by, deleted_at, deleted_by, order_id, status_id, comment, comment2, field1, field2, field3, field4, field5) VALUES (750, 1614669739, 111, null, null, null, null, 75, 7, '<p>Дмитрий, по заявке необходимо:</p>  <p>1) на вкл Супруга и Дети вложить Выписку из ДК (по адресу мкр Саввино, ул. Калинина 22-37)</p>  <p>2) на вкл Сотрудник вложить ваш Паспорт (все страницы), предлагаю пере сканировать документ, т.к. приложенный файл не читается</p>  <p>3) на вкл Финансы по полю «Справка 2 НДФЛ на супругу» вложить актуальную Справку<strong> </strong>из Налоговой инспекции </p>  <p>4) на вкл Жилье вложить Акт приема-передачи и ЕГРН (Св-во о собственности на жилье)</p>  <p>5) на вкл Документы нажать на Сохранить, после выгрузить бланк Заявления, распечатать, подписать и вложить новый бланк заявления.</p>', null, null, null, null, null, null);
INSERT INTO workshop.jk_order_stage (id, created_at, created_by, updated_at, updated_by, deleted_at, deleted_by, order_id, status_id, comment, comment2, field1, field2, field3, field4, field5) VALUES (751, 1614669930, 111, null, null, null, null, 78, 7, '<p>Полина, по заявке необходимо:</p>  <p>1) на вкл Дети вложить Заявление о фактическом месте проживания от отца (приложенный скан не читается, предлагаю пере сканировать документ)</p>  <p>2) на вкл Жилье вложить архив Договора приобретения жилья с ЭЦП </p>  <p>3) на вкл Документы нажать на Сохранить, после выгрузить бланк Заявления, распечатать, подписать и вложить новый бланк заявления, </p>  <p>Вложить Согласие на обработку ПД по вам (приложенный скан не читается, предлагаю пере сканировать документ).</p>', null, null, null, null, null, null);
