INSERT INTO workshop.jk_order_stage (id, created_at, created_by, updated_at, updated_by, deleted_at, deleted_by, order_id, status_id, comment, comment2, field1, field2, field3, field4, field5) VALUES (753, 1614671112, 111, null, null, null, null, 98, 7, '<p>Михаил, по заявке необходимо:</p>  <p>1) на вкл Финансы вложить 2НДФЛ за 2020г (приложенный файл не читается, предлагаю пере сканировать документ)</p>  <p>2) на вкл Ипотека вложить Первоначальный График платежей, а Актуальный график платежей вложить в соответствующее поле.</p>  <p>3) на вкл Документы нажать на Сохранить, после выгрузить бланк Заявления, распечатать, подписать и вложить новый бланк заявления.</p>', null, null, null, null, null, null);
