INSERT INTO workshop.jk_order_stage (id, created_at, created_by, updated_at, updated_by, deleted_at, deleted_by, order_id, status_id, comment, comment2, field1, field2, field3, field4, field5) VALUES (756, 1614673906, 111, null, null, null, null, 103, 7, '<p>Ольга, по заявке необходимо:</p>  <p>1) на вкл. Дети вложить Заявление о фактическом месте проживания от папы (в ЛК вложен пустой лист)</p>  <p>2) на вкл Финансы по полю «Справка 2 НДФЛ по вам» вложить актуальную Справку<strong> </strong>(у приложенной истек срок годности) </p>  <p>3) на вкл Сотрудник вложить Договор Аренды (приложенный файл не читается, необходимо пере сканировать документ)</p>  <p>4) на вкл Жилье по полю «Я и члены моей семьи имеем в собственности следующие жилые помещения (доли в жилых помещениях)» уточнить долю, которой владеет супруг 1/? По квартире на ул. Плотникова</p>  <p>5) на вкл Ипотека уточнить тсточники формирования полной стоимости квартиры</p>  <p>15 млн = 7 млн (СС)+1 млн (займ) +7 млн (за счет чего???)</p>', null, null, null, null, null, null);
