INSERT INTO workshop.jk_order_stage (id, created_at, created_by, updated_at, updated_by, deleted_at, deleted_by, order_id, status_id, comment, comment2, field1, field2, field3, field4, field5) VALUES (762, 1614685504, 111, null, null, null, null, 107, 7, '<p>Сергей, по заявке необходимо уточнить:</p><p>На настоящий момент у вас и членов вашей семьи в собственности 98,2 кв.м.? Превышает корпоративную норму на 3х человек 60 кв.м.?<br></p>', null, null, null, null, null, null);
