INSERT INTO workshop.jk_order_stage (id, created_at, created_by, updated_at, updated_by, deleted_at, deleted_by, order_id, status_id, comment, comment2, field1, field2, field3, field4, field5) VALUES (764, 1614688214, 111, null, null, null, null, 109, 7, '<p>Эдуард, по заявке необходимо:</p>  <p>1) по вкл. Жилье вложить ЭЦП по Договору приобретения Жилого помещения </p>  <p>2) по вкл. Ипотека вложить Актуальный График платежей (если за период пользования кредитом у вас были досрочные платежи)</p>', null, null, null, null, null, null);
