INSERT INTO workshop.jk_order_stage (id, created_at, created_by, updated_at, updated_by, deleted_at, deleted_by, order_id, status_id, comment, comment2, field1, field2, field3, field4, field5) VALUES (767, 1614691830, 111, null, null, null, null, 110, 7, '<p>Александр, по заявлению необходимо:</p>  <p>1)По вкл. Дети вложить Заявления о фактическом месте проживания от мамы, от папы  ПОЛНОСТЬ ЗАПОЛНЕННЫЕ ОТ РУКИ. Можно оформить одно заявление от мамы, отпапы на 3х детей (итого 2 заявления вместо 6ти)</p>  <p>Степан:вложить Св-во о рождении, св-во о регистрации по месту жительства  (приложенные файлы не читаются, предлагаю пере сканировать документы)</p>  <p>Валерия: вложить Св-во о регистрации по месту жительства  (приложенный файл не читается, предлагаю пере сканировать документ)</p>  <p>2)По вкл. Жилье прошу уточнить почему вы проживаете отдельно от семьи? Если это ошибка, то необходимо уточнить заявление</p>  <p>3)По вкл. Ипотека вложить Актуальный График платежей. Из приложенной выписки 2016г не понятно актуальна она или нет, графы не подписаны, какой столбец относится к Процентам- не понятно</p>  <p>4)По вкл. Супруга вложить Трудовую книжку </p>  <p>5)По вкл. Документы вложить согласие на обработку ПД по всем чл.семьи (приложенные файлы не читаются, предлагаю пере сканировать документы)</p>  <p>Повторно выгрузить Заявление, подписать и вложить в соответствующее поле</p>', null, null, null, null, null, null);
