INSERT INTO workshop.jk_order_stage (id, created_at, created_by, updated_at, updated_by, deleted_at, deleted_by, order_id, status_id, comment, comment2, field1, field2, field3, field4, field5) VALUES (776, 1614756211, 111, null, null, null, null, 117, 7, '<p>Никита, по заявке необходимо:</p>  <ul><li>По вкл. Жилье вложить ЭЦП по Договору купли-продажи</li><li>По вкл. Финансы вложить 2НДФЛ (Вложенный файл не читается, необходимо пере сканировать документ)</li><li>По вкл. Документы вложить Согласие на обработку ПД (Вложенный файл не читается, необходимо пере сканировать документ)</li></ul>      <p>Выгрузить повторно заявление, подписать и вложить в соответствующее поле.</p>', null, null, null, null, null, null);
