INSERT INTO workshop.jk_order_stage (id, created_at, created_by, updated_at, updated_by, deleted_at, deleted_by, order_id, status_id, comment, comment2, field1, field2, field3, field4, field5) VALUES (798, 1614775690, 1478, null, null, null, null, 152, 2, 'Согласование руководителями', null, null, null, null, null, null);
INSERT INTO workshop.jk_order_stage (id, created_at, created_by, updated_at, updated_by, deleted_at, deleted_by, order_id, status_id, comment, comment2, field1, field2, field3, field4, field5) VALUES (799, 1614775810, 166, null, null, null, null, 41, 7, '<p>Добрый день!</p><p>Необходимо изменить вкадку Ипотека</p><p>Вложение "Одобрение банка" не доступно для просмотра</p><p>Нет справки 2 НДФЛ-супруги</p><p>Вложение "прочие документы" не достпны для просмотра.</p><p><br></p>', null, null, null, null, null, null);
INSERT INTO workshop.jk_order_stage (id, created_at, created_by, updated_at, updated_by, deleted_at, deleted_by, order_id, status_id, comment, comment2, field1, field2, field3, field4, field5) VALUES (800, 1614776830, 187, null, null, null, null, 142, 7, '<p>Добрый день!</p><p>1. Вкладка Ипотека Полная стоимость = Собственные средства + Ипотека + Займ</p><p>В настоящий момент сумма не идет. Необходимо либо откорректировать собственные средства, либо добавить ипотеку.</p><p>2. Вкладка Финансы. Нет справки 2НДФЛ. Необходимо добавить. Это обязательный документ.</p><p>3. Вкладка Документы. Вложена некорректная форма заявления. Необходимо внести все изменения, а затем заново сформировать бланк заявления.<br></p>', null, null, null, null, null, null);
