INSERT INTO workshop.jk_order_stage (id, created_at, created_by, updated_at, updated_by, deleted_at, deleted_by, order_id, status_id, comment, comment2, field1, field2, field3, field4, field5) VALUES (811, 1614841855, 163, null, null, null, null, 153, 7, '<p>1. Приложить паспорт (не открывается документ)</p><p>2. Удалить с закладки жилье все сведения о Седельникове А.И. (Отец не является членом семьи)</p><p>3. Указать покупку своего жилья и адрес</p><p>4. Отредактировать доход (согласно 2 НДФЛ он составляет 24065,62)</p><p>5. Отредактироывать процентную ставку - 6,1%</p><p>6. После устранения замечаний приложить откорректированное заявление</p>', null, null, null, null, null, null);
